    false,nt"url": null,nt"notes": "This data set includes four georeferenced
    versions of original black and white aerial photographs obtained from Earth Explorer
    (USGS) on October 28th and November 4th, 1954, over Quivira National Wildlife Refuge.
     The original photos were georeferenced against Stafford County NAIP (2012) imagery.
    These images represents the refuge landscape approximately 3 years before the establishment
    of Quivira National Wildlife Refuge. These images allows a great look back in time
    to interpret habitat types and land use patterns.  These changes and others (extent
    of woody vegetation) can be made from this image using current imagery for comparison.
    These images, and others, are being used by refuge staff to assist in understanding
    and visualizing the historical content of the lands within the refuge and how they
    have changed over the last 80 years. Pixel resolution of this image is  5.02 meters.
    These images should be used for resource-level interpretation only.",nt"license_title":
